import React from 'react'

export const StockQuote= (props) => {
    return (

        <li className="stock-item">
             <button className="dlt-stock" >x</button>{props.stock.symbol.split('.')[0]}<span className="stock-price">${props.price}</span><span>{props.stock.shares}</span><span>${parseInt(props.stock.price*props.stock.shares)}</span>

       </li>
    )
}

export default StockQuote;
